INSERT INTO `account_detail_types` (`id`, `business_id`, `account_subtype_id`, `name`, `description`, `active`, `created_at`, `updated_at`) VALUES
(1, 0, 1, 'Allowance for bad debts', 'Use Allowance for bad debts to estimate the part of Accounts Receivable that you think you might not collect. Use this only if you are keeping your books on the accrual basis.', 1, '2023-09-25 21:18:01', '2023-09-25 21:18:01'),
(2, 0, 1, 'Assets available for sale', 'Use Assets available for sale to track assets that are available for sale that are not expected to be held for a long period of time.', 1, '2023-09-25 21:18:01', '2023-09-25 21:18:01'),
(3, 0, 1, 'Development costs', 'Use Development costs to track amounts you deposit or set aside to arrange for financing, such as an SBA loan, or for deposits in anticipation of the purchase of property or other assets. When the deposit is refunded, or the purchase takes place, remove the amount from this account.', 1, '2023-09-25 21:18:01', '2023-09-25 21:18:01'),
(4, 0, 1, 'Employee cash advances', 'Use Employee cash advances to track employee wages and salary you issue to an employee early, or other non-salary money given to employees. If you make a loan to an employee, use the Current asset account type called Loans to others, instead.', 1, '2023-09-25 21:18:01', '2023-09-25 21:18:01'),
(5, 0, 1, 'Inventory', 'Use Inventory to track the cost of goods your business purchases for resale. When the goods are sold, assign the sale to a Cost of sales account.', 1, '2023-09-25 21:18:01', '2023-09-25 21:18:01'),
(6, 0, 1, 'Investments - Other', 'Use Investments - Other to track the value of investments not covered by other investment account types. Examples include publicly-traded shares, coins, or gold.', 1, '2023-09-25 21:18:01', '2023-09-25 21:18:01'),
(7, 0, 1, 'Loans to officers', 'If you operate your business as a Corporation, use Loans to officers to track money loaned to officers of your business.', 1, '2023-09-25 21:18:01', '2023-09-25 21:18:01'),
(8, 0, 1, 'Loans to others', 'Use Loans to others to track money your business loans to other people or businesses. This type of account is also referred to as Notes Receivable. For early salary payments to employees, use Employee cash advances, instead.', 1, '2023-09-25 21:18:01', '2023-09-25 21:18:01'),
(9, 0, 1, 'Loans to Shareholders', 'If you operate your business as a Corporation, use Loans to Shareholders to track money your business loans to its shareholders', 1, '2023-09-25 21:18:01', '2023-09-25 21:18:01'),
(10, 0, 1, 'Other current assets', 'Use Other current assets for current assets not covered by the other types. Current assets are likely to be converted to cash or used up in a year.', 1, '2023-09-25 21:18:01', '2023-09-25 21:18:01'),
(11, 0, 1, 'Prepaid expenses', 'Use Prepaid expenses to track payments for expenses that you won\'t recognise until your next accounting period. When you recognise the expense, make a journal entry to transfer money from this account to the expense account.', 1, '2023-09-25 21:18:01', '2023-09-25 21:18:01'),
(12, 0, 1, 'Retainage', 'Use Retainage if your customers regularly hold back a portion of a contract amount until you have completed a project. This type of account is often used in the construction industry, and only if you record income on an accrual basis.', 1, '2023-09-25 21:18:01', '2023-09-25 21:18:01'),
(13, 0, 1, 'Undeposited funds', 'Use Undeposited funds for cash or cheques from sales that haven\'t been deposited yet. For petty cash, use Cash on hand, instead.', 1, '2023-09-25 21:18:01', '2023-09-25 21:18:01'),
(14, 0, 2, 'Accumulated amortisation of non-current assets', 'Use Accumulated amortisation of non-current assets to track how much you\'ve amortised an asset whose type is Non-Current Asset.', 1, '2023-09-25 21:18:01', '2023-09-25 21:18:01'),
(15, 0, 2, 'Assets held for sale', 'Use Assets held for sale to track assets of a company that are available for sale that are not expected to be held for a long period of time.', 1, '2023-09-25 21:18:01', '2023-09-25 21:18:01'),
(16, 0, 2, 'Deferred tax', 'Use Deferred tax for tax liabilities or assets that are to be used in future accounting periods.', 1, '2023-09-25 21:18:01', '2023-09-25 21:18:01'),
(17, 0, 2, 'Goodwill', 'Use Goodwill only if you have acquired another company. It represents the intangible assets of the acquired company which gave it an advantage, such as favourable government relations, business name, outstanding credit ratings, location, superior management, customer lists, product quality, or good labour relations.', 1, '2023-09-25 21:18:01', '2023-09-25 21:18:01'),
(18, 0, 2, 'Intangible assets', 'Use Intangible assets to track intangible assets that you plan to amortise. Examples include franchises, customer lists, copyrights, and patents.', 1, '2023-09-25 21:18:01', '2023-09-25 21:18:01'),
(19, 0, 2, 'Lease buyout', 'Use Lease buyout to track lease payments to be applied toward the purchase of a leased asset. You don\'t track the leased asset itself until you purchase it.', 1, '2023-09-25 21:18:01', '2023-09-25 21:18:01'),
(20, 0, 2, 'Licences', 'Use Licences to track non-professional licences for permission to engage in an activity, like selling alcohol or radio broadcasting. For fees associated with professional licences granted to individuals, use a Legal and professional fees expense account, instead.', 1, '2023-09-25 21:18:01', '2023-09-25 21:18:01'),
(21, 0, 2, 'Long-term investments', 'Use Long-term investments to track investments that have a maturity date of longer than one year.', 1, '2023-09-25 21:18:01', '2023-09-25 21:18:01'),
(22, 0, 2, 'Organisational costs', 'Use Organisational costs to track costs incurred when forming a partnership or corporation. The costs include the legal and accounting costs necessary to organise the company, facilitate the filings of the legal documents, and other paperwork.', 1, '2023-09-25 21:18:01', '2023-09-25 21:18:01'),
(23, 0, 2, 'Other non-current assets', 'Use Other non-current assets to track assets not covered by other types. Non-current assets are long-term assets that are expected to provide value for more than one year.', 1, '2023-09-25 21:18:01', '2023-09-25 21:18:01'),
(24, 0, 2, 'Security deposits', 'Use Security deposits to track funds you\'ve paid to cover any potential costs incurred by damage, loss, or theft. The funds should be returned to you at the end of the contract. If you accept down payments, advance payments, security deposits, or other kinds of deposits, use an Other Current liabilities account with the detail type Other Current liabilities.', 1, '2023-09-25 21:18:01', '2023-09-25 21:18:01'),
(25, 0, 3, 'Accumulated depletion', 'Use Accumulated depletion to track how much you deplete a natural resource.', 1, '2023-09-25 21:18:01', '2023-09-25 21:18:01'),
(26, 0, 3, 'Accumulated depreciation on property, plant and equipment', 'Use Accumulated depreciation on property, plant and equipment to track how much you depreciate a fixed asset (a physical asset you do not expect to convert to cash during one year of normal operations).', 1, '2023-09-25 21:18:01', '2023-09-25 21:18:01'),
(27, 0, 3, 'Buildings', 'Use Buildings to track the cost of structures you own and use for your business. If you have a business in your home, consult your accountant. Use a Land account for the land portion of any real property you own, splitting the cost of the property between land and building in a logical method. A common method is to mimic the land-to-building ratio on the property tax statement.', 1, '2023-09-25 21:18:01', '2023-09-25 21:18:01'),
(28, 0, 3, 'Depletable assets', 'Use Depletable assets to track natural resources, such as timberlands, oil wells, and mineral deposits.', 1, '2023-09-25 21:18:01', '2023-09-25 21:18:01'),
(29, 0, 3, 'Furniture and fixtures', 'Use Furniture and fixtures to track any furniture and fixtures your business owns and uses, like a dental chair or sales booth.', 1, '2023-09-25 21:18:01', '2023-09-25 21:18:01'),
(30, 0, 3, 'Land', 'Use Land to track assets that are not easily convertible to cash or not expected to become cash within the next year. For example, leasehold improvements.', 1, '2023-09-25 21:18:01', '2023-09-25 21:18:01'),
(31, 0, 3, 'Leasehold improvements', 'Use Leasehold improvements to track improvements to a leased asset that increases the asset\'s value. For example, if you carpet a leased office space and are not reimbursed, that\'s a leasehold improvement.', 1, '2023-09-25 21:18:01', '2023-09-25 21:18:01'),
(32, 0, 3, 'Machinery and equipment', 'Use Machinery and equipment to track computer hardware, as well as any other non-furniture fixtures or devices owned and used for your business. This includes equipment that you ride, like tractors and lawn mowers. Cars and lorries, however, should be tracked with Vehicle accounts, instead.', 1, '2023-09-25 21:18:01', '2023-09-25 21:18:01'),
(33, 0, 3, 'Other fixed asset', 'Use Other fixed asset for fixed assets that are not covered by other asset types. Fixed assets are physical property that you use in your business and that you do not expect to convert to cash or be used up during one year of normal operations.', 1, '2023-09-25 21:18:01', '2023-09-25 21:18:01'),
(34, 0, 3, 'Vehicles', 'Use Vehicles to track the value of vehicles your business owns and uses for business. This includes off-road vehicles, air planes, helicopters, and boats. If you use a vehicle for both business and personal use, consult your accountant to see how you should track its value.', 1, '2023-09-25 21:18:01', '2023-09-25 21:18:01'),
(35, 0, 4, 'Accounts Receivable(A/R)', 'Accounts receivable (also called A/R, Debtors, or Trade and other receivables) tracks money that customers owe you for products or services, and payments customers make. Ultimate Pos -Accounting Module  automatically creates one Accounts receivable account for you. Most businesses need only one. Each customer has a register, which functions like an Accounts receivable account for each customer.', 1, '2023-09-25 21:18:01', '2023-09-25 21:18:01'),
(36, 0, 5, 'Bank', 'Use Bank accounts to track all your current activity, including debit card transactions. Each current account your company has at a bank or other financial institution should have its own Bank type account in Ultimate POS.', 1, '2023-09-25 21:18:01', '2023-09-25 21:18:01'),
(37, 0, 5, 'Cash and Cash Equivalents', 'Use Cash and Cash Equivalents to track cash or assets that can be converted into cash immediately. For example, marketable securities and Treasury bills.', 1, '2023-09-25 21:18:01', '2023-09-25 21:18:01'),
(38, 0, 5, 'Cash on hand', 'Use a Cash on hand account to track cash your company keeps for occasional expenses, also called petty cash. To track cash from sales that have not been deposited yet, use a pre-created account called Undeposited funds, instead.', 1, '2023-09-25 21:18:01', '2023-09-25 21:18:01'),
(39, 0, 5, 'Client trust accounts', 'Use Client trust accounts for money held by you for the benefit of someone else. For example, trust accounts are often used by attorneys to keep track of expense money their customers have given them. Often, to keep the amount in a trust account from looking like it\'s yours, the amount is offset in a \"contra\" liability account (a Current Liability).', 1, '2023-09-25 21:18:01', '2023-09-25 21:18:01'),
(40, 0, 5, 'Money market', 'Use Money market to track amounts in money market accounts. For investments, see Current Assets, instead.', 1, '2023-09-25 21:18:01', '2023-09-25 21:18:01'),
(41, 0, 5, 'Rents held in trust', 'Use Rents held in trust to track deposits and rent held on behalf of the property owners. Typically only property managers use this type of account.', 1, '2023-09-25 21:18:01', '2023-09-25 21:18:01'),
(42, 0, 5, 'Savings', 'Use Savings accounts to track your savings and CD activity. Each savings account your company has at a bank or other financial institution should have its own Savings type account. For investments, see Current Assets, instead.', 1, '2023-09-25 21:18:01', '2023-09-25 21:18:01'),
(43, 0, 6, 'Accrued Liabilities', 'Use Accrued Liabilities to track expenses that a business has incurred but has not yet paid. For example, pensions for companies that contribute to a pension fund for their employees for their retirement.', 1, '2023-09-25 21:18:01', '2023-09-25 21:18:01'),
(44, 0, 6, 'Client Trust accounts - liabilities', 'Use Client Trust accounts - liabilities to offset Client Trust accounts in assets. Amounts in these accounts are held by your business on behalf of others. They do not belong to your business, so should not appear to be yours on your balance sheet. This \"contra\" account takes care of that, as long as the two balances match.', 1, '2023-09-25 21:18:01', '2023-09-25 21:18:01'),
(45, 0, 6, 'Current tax liability', 'Use Current tax liability to track the total amount of taxes collected but not yet paid to the government.', 1, '2023-09-25 21:18:01', '2023-09-25 21:18:01'),
(46, 0, 6, 'Current portion of obligations under finance leases', 'Use Current portion of obligations under finance leases to track the value of lease payments due within the next 12 months.', 1, '2023-09-25 21:18:01', '2023-09-25 21:18:01'),
(47, 0, 6, 'Dividends payable', 'Use Dividends payable to track dividends that are owed to shareholders but have not yet been paid.', 1, '2023-09-25 21:18:01', '2023-09-25 21:18:01'),
(48, 0, 6, 'Income tax payable', 'Use Income tax payable to track monies that are due to pay the company\'s income tax liabilties.', 1, '2023-09-25 21:18:01', '2023-09-25 21:18:01'),
(49, 0, 6, 'Insurance payable', 'Use Insurance payable to keep track of insurance amounts due. This account is most useful for businesses with monthly recurring insurance expenses.', 1, '2023-09-25 21:18:01', '2023-09-25 21:18:01'),
(50, 0, 6, 'Line of credit', 'Use Line of credit to track the balance due on any lines of credit your business has. Each line of credit your business has should have its own Line of credit account.', 1, '2023-09-25 21:18:01', '2023-09-25 21:18:01'),
(51, 0, 6, 'Loan payable', 'Use Loan payable to track loans your business owes which are payable within the next twelve months. For longer-term loans, use the Long-term liability called Notes payable, instead.', 1, '2023-09-25 21:18:01', '2023-09-25 21:18:01'),
(52, 0, 6, 'Other current liabilities', 'Use Other current liabilities to track monies owed by the company and due within one year.', 1, '2023-09-25 21:18:01', '2023-09-25 21:18:01'),
(53, 0, 6, 'Payroll clearing', 'Use Payroll clearing to keep track of any non-tax amounts that you have deducted from employee paycheques or that you owe as a result of doing payroll. When you forward money to the appropriate suppliers, deduct the amount from the balance of this account. Do not use this account for tax amounts you have withheld or owe from paying employee wages. For those amounts, use the Payroll tax payable account instead.', 1, '2023-09-25 21:18:01', '2023-09-25 21:18:01'),
(54, 0, 6, 'Payroll liabilities', 'Use Payroll liabilities to keep track of tax amounts that you owe to government agencies as a result of paying wages. This includes taxes withheld, health care premiums, employment insurance, government pensions, etc. When you forward the money to the government agency, deduct the amount from the balance of this account.', 1, '2023-09-25 21:18:01', '2023-09-25 21:18:01'),
(55, 0, 6, 'Prepaid expenses payable', 'Use Prepaid expenses payable to track items such as property taxes that are due, but not yet deductible as an expense because the period they cover has not yet passed.', 1, '2023-09-25 21:18:01', '2023-09-25 21:18:01'),
(56, 0, 6, 'Rents in trust - Liability', 'Use Rents in trust - liability to offset the Rents in trust amount in assets. Amounts in these accounts are held by your business on behalf of others. They do not belong to your business, so should not appear to be yours on your balance sheet. This \"contra\" account takes care of that, as long as the two balances match.', 1, '2023-09-25 21:18:01', '2023-09-25 21:18:01'),
(57, 0, 6, 'Sales and service tax payable', 'Use Sales and service tax payable to track tax you have collected, but not yet remitted to your government tax agency. This includes value-added tax, goods and services tax, sales tax, and other consumption tax.', 1, '2023-09-25 21:18:01', '2023-09-25 21:18:01'),
(58, 0, 7, 'Accrued holiday payable', 'Use Accrued holiday payable to track holiday earned but that has not been paid out to employees.', 1, '2023-09-25 21:18:01', '2023-09-25 21:18:01'),
(59, 0, 7, 'Accrued Non-current liabilities', 'Use Accrued Non-current liabilities to track expenses that a business has incurred but has not yet paid. For example, pensions for companies that contribute to a pension fund for their employees for their retirement.', 1, '2023-09-25 21:18:01', '2023-09-25 21:18:01'),
(60, 0, 7, 'Liabilities related to assets held for sale', 'Use Liabilities related to assets held for sale to track any liabilities that are directly related to assets being sold or written off.', 1, '2023-09-25 21:18:01', '2023-09-25 21:18:01'),
(61, 0, 7, 'Long-term debt', 'Use Long-term debt to track loans and obligations with a maturity of longer than one year. For example, mortgages.', 1, '2023-09-25 21:18:01', '2023-09-25 21:18:01'),
(62, 0, 7, 'Notes payable', 'Use Notes payable to track the amounts your business owes in long-term (over twelve months) loans. For shorter loans, use the Current liability account type called Loan payable, instead.', 1, '2023-09-25 21:18:01', '2023-09-25 21:18:01'),
(63, 0, 7, 'Other non-current liabilities', 'Use Other non-current liabilities to track liabilities due in more than twelve months that don\'t fit the other Non-Current liability account types.', 1, '2023-09-25 21:18:01', '2023-09-25 21:18:01'),
(64, 0, 7, 'Shareholder notes payable', 'Use Shareholder notes payable to track long-term loan balances your business owes its shareholders.', 1, '2023-09-25 21:18:01', '2023-09-25 21:18:01'),
(65, 0, 8, 'Accounts Payable (A/P)', 'Accounts payable (also called A/P, Trade and other payables, or Creditors) tracks amounts you owe to your suppliers. Ultimate POS automatically creates one Accounts Payable account for you. Most businesses need only one.', 1, '2023-09-25 21:18:01', '2023-09-25 21:18:01'),
(66, 0, 9, 'Credit Card', 'Credit card accounts track the balance due on your business credit cards. Create one Credit card account for each credit card account your business uses.', 1, '2023-09-25 21:18:01', '2023-09-25 21:18:01'),
(67, 0, 10, 'Accumulated Adjustment', 'Some corporations use this account to track adjustments to owner\'s equity that are not attributable to net income.', 1, '2023-09-25 21:18:01', '2023-09-25 21:18:01'),
(68, 0, 10, 'Dividend disbursed', 'Use Dividend disbursed to track a payment given to its shareholders out of the company\'s retained earnings.', 1, '2023-09-25 21:18:01', '2023-09-25 21:18:01'),
(69, 0, 10, 'Equity in earnings of subsidiaries', 'Use Equity in earnings of subsidiaries to track the original investment in shares of subsidiaries plus the share of earnings or losses from the operations of the subsidiary.', 1, '2023-09-25 21:18:01', '2023-09-25 21:18:01'),
(70, 0, 10, 'Opening balance equity', 'Ultimate POS creates this account the first time you enter an opening balance for a balance sheet account. As you enter opening balances, Ultimate POS records the amounts in Opening balance equity. This ensures that you have a correct balance sheet for your company, even before you\'ve finished entering all your company\'s assets and liabilities.', 1, '2023-09-25 21:18:01', '2023-09-25 21:18:01'),
(71, 0, 10, 'Ordinary shares', 'Corporations use Ordinary shares to track its ordinary shares in the hands of shareholders. The amount in this account should be the stated (or par) value of the stock.', 1, '2023-09-25 21:18:01', '2023-09-25 21:18:01'),
(72, 0, 10, 'Other comprehensive income', 'Use Other comprehensive income to track the increases or decreases in income from various businesses that is not yet absorbed by the company.', 1, '2023-09-25 21:18:01', '2023-09-25 21:18:01'),
(73, 0, 10, 'Owner\'s Equity', 'Corporations use Owner\'s equity to show the cumulative net income or loss of their business as of the beginning of the financial year.', 1, '2023-09-25 21:18:01', '2023-09-25 21:18:01'),
(74, 0, 10, 'Paid-in capital or Surplus', 'Corporations use Paid-in capital to track amounts received from shareholders in exchange for shares that are over and above the shares\' stated (or par) value.', 1, '2023-09-25 21:18:01', '2023-09-25 21:18:01'),
(75, 0, 10, 'Partner contributions', 'Partnerships use Partner contributions to track amounts partners contribute to the partnership during the year.', 1, '2023-09-25 21:18:01', '2023-09-25 21:18:01'),
(76, 0, 10, 'Partner distributions', 'Partnerships use Partner distributions to track amounts distributed by the partnership to its partners during the year. Don\'t use this for regular payments to partners for interest or service. For regular payments, use a Guaranteed payments account (a Expense account in Payroll expenses), instead.', 1, '2023-09-25 21:18:01', '2023-09-25 21:18:01'),
(77, 0, 10, 'Partner\'s Equity', 'Partnerships use Partner\'s equity to show the income remaining in the partnership for each partner as of the end of the prior year.', 1, '2023-09-25 21:18:01', '2023-09-25 21:18:01'),
(78, 0, 10, 'Preferred Shares', 'Corporations use this account to track its preferred shares in the hands of shareholders. The amount in this account should be the stated (or par) value of the shares.', 1, '2023-09-25 21:18:01', '2023-09-25 21:18:01'),
(79, 0, 10, 'Retained earnings', 'Ultimate POS adds this account when you create your company. Retained earnings tracks net income from previous financial years. Ultimate POS automatically transfers your profit (or loss) to Retained earnings at the end of each financial year.', 1, '2023-09-25 21:18:01', '2023-09-25 21:18:01'),
(80, 0, 10, 'Share capital', 'Use Share capital to track the funds raised by issuing shares.', 1, '2023-09-25 21:18:01', '2023-09-25 21:18:01'),
(81, 0, 10, 'Treasury shares', 'Corporations use Treasury shares to track amounts paid by the corporation to buy its own shares back from shareholders.', 1, '2023-09-25 21:18:01', '2023-09-25 21:18:01'),
(82, 0, 11, 'Discounts/refunds given', 'Use Discounts/refunds given to track discounts you give to customers. This account typically has a negative balance so it offsets other income. For discounts from suppliers, use an expense account, instead.', 1, '2023-09-25 21:18:01', '2023-09-25 21:18:01'),
(83, 0, 11, 'Non-profit income', 'Use Non-profit income to track money coming in if you are a non-profit organisation.', 1, '2023-09-25 21:18:01', '2023-09-25 21:18:01'),
(84, 0, 11, 'Other primary income', 'Use Other primary income to track income from normal business operations that doesn\'t fall into another Income type.', 1, '2023-09-25 21:18:01', '2023-09-25 21:18:01'),
(85, 0, 11, 'Revenue - General', 'Use Revenue - General to track income from normal business operations that do not fit under any other category.', 1, '2023-09-25 21:18:01', '2023-09-25 21:18:01'),
(86, 0, 11, 'Sales - retail', 'Use Sales - retail to track sales of goods/services that have a mark-up cost to consumers.', 1, '2023-09-25 21:18:01', '2023-09-25 21:18:01'),
(87, 0, 11, 'Sales - wholesale', 'Use Sales - wholesale to track the sale of goods in quantity for resale purposes.', 1, '2023-09-25 21:18:01', '2023-09-25 21:18:01'),
(88, 0, 11, 'Sales of Product Income', 'Use Sales of product income to track income from selling products. This can include all kinds of products, like crops and livestock, rental fees, performances, and food served.', 1, '2023-09-25 21:18:01', '2023-09-25 21:18:01'),
(89, 0, 11, 'Service/fee income', 'Use Service/fee income to track income from services you perform or ordinary usage fees you charge. For fees customers pay you for late payments or other uncommon situations, use an Other Income account type called Other miscellaneous income, instead.', 1, '2023-09-25 21:18:01', '2023-09-25 21:18:01'),
(90, 0, 11, 'Unapplied Cash Payment Income', 'Unapplied Cash Payment Income reports the Cash Basis income from customers payments you\'ve received but not applied to invoices or charges. In general, you would never use this directly on a purchase or sale transaction.', 1, '2023-09-25 21:18:01', '2023-09-25 21:18:01'),
(91, 0, 12, 'Dividend income', 'Use Dividend income to track taxable dividends from investments.', 1, '2023-09-25 21:18:01', '2023-09-25 21:18:01'),
(92, 0, 12, 'Interest earned', 'Use Interest earned to track interest from bank or savings accounts, investments, or interest payments to you on loans your business made.', 1, '2023-09-25 21:18:01', '2023-09-25 21:18:01'),
(93, 0, 12, 'Loss on disposal of assets', 'Use Loss on disposal of assets to track losses realised on the disposal of assets.', 1, '2023-09-25 21:18:01', '2023-09-25 21:18:01'),
(94, 0, 12, 'Other investment income', 'Use Other investment income to track other types of investment income that isn\'t from dividends or interest.', 1, '2023-09-25 21:18:01', '2023-09-25 21:18:01'),
(95, 0, 12, 'Other miscellaneous income', 'Use Other miscellaneous income to track income that isn\'t from normal business operations, and doesn\'t fall into another Other Income type.', 1, '2023-09-25 21:18:01', '2023-09-25 21:18:01'),
(96, 0, 12, 'Other operating income', 'Use Other operating income to track income from activities other than normal business operations. For example, Investment interest, foreign exchange gains, and rent income.', 1, '2023-09-25 21:18:01', '2023-09-25 21:18:01'),
(97, 0, 12, 'Tax-exempt interest', 'Use Tax-exempt interest to record interest that isn\'t taxable, such as interest on money in tax-exempt retirement accounts, or interest from tax-exempt bonds.', 1, '2023-09-25 21:18:01', '2023-09-25 21:18:01'),
(98, 0, 12, 'Unrealised loss on securities, net of tax', 'Use Unrealised loss on securities, net of tax to track losses on securities that have occurred but are yet been realised through a transaction. For example, shares whose value has fallen but that are still being held.', 1, '2023-09-25 21:18:01', '2023-09-25 21:18:01'),
(99, 0, 13, 'Advertising/Promotional', 'Use Advertising/promotional to track money spent promoting your company. You may want different accounts of this type to track different promotional efforts (Yellow Pages, newspaper, radio, flyers, events, and so on). If the promotion effort is a meal, use Promotional meals instead.', 1, '2023-09-25 21:18:01', '2023-09-25 21:18:01'),
(100, 0, 13, 'Amortisation Expense', 'Use Amortisation expense to track writing off of assets (such as intangible assets or investments) over the projected life of the assets.', 1, '2023-09-25 21:18:01', '2023-09-25 21:18:01'),
(101, 0, 13, 'Auto', 'Use Auto to track costs associated with vehicles. You may want different accounts of this type to track petrol, repairs, and maintenance. If your business owns a car or lorry, you may want to track its value as a Fixed Asset, in addition to tracking its expenses.', 1, '2023-09-25 21:18:01', '2023-09-25 21:18:01'),
(102, 0, 13, 'Bad debt', 'Use Bad debt to track debt you have written off.', 1, '2023-09-25 21:18:01', '2023-09-25 21:18:01'),
(103, 0, 13, 'Bank charges', 'Use Bank charges for any fees you pay to financial institutions.', 1, '2023-09-25 21:18:01', '2023-09-25 21:18:01'),
(104, 0, 13, 'Charitable contributions', 'Use Charitable contributions to track gifts to charity.', 1, '2023-09-25 21:18:01', '2023-09-25 21:18:01'),
(105, 0, 13, 'Commissions and fees', 'Use Commissions and fees to track amounts paid to agents (such as brokers) in order for them to execute a trade.', 1, '2023-09-25 21:18:01', '2023-09-25 21:18:01'),
(106, 0, 13, 'Cost of labour', 'Use Cost of labour to track the cost of paying employees to produce products or supply services. It includes all employment costs, including food and transportation, if applicable. This account is also available as a Cost of Sales (COS) account.', 1, '2023-09-25 21:18:01', '2023-09-25 21:18:01'),
(107, 0, 13, 'Dues and subscriptions', 'Use Dues and subscriptions to track dues and subscriptions related to running your business. You may want different accounts of this type for professional dues, fees for licences that can\'t be transferred, magazines, newspapers, industry publications, or service subscriptions.', 1, '2023-09-25 21:18:01', '2023-09-25 21:18:01'),
(108, 0, 13, 'Equipment rental', 'Use Equipment rental to track the cost of renting equipment to produce products or services. This account is also available as a Cost of Sales account. If you purchase equipment, use a Fixed asset account type called Machinery and equipment.', 1, '2023-09-25 21:18:01', '2023-09-25 21:18:01'),
(109, 0, 13, 'Finance costs', 'Use Finance costs to track the costs of obtaining loans or credit. Examples of finance costs would be credit card fees, interest and mortgage costs.', 1, '2023-09-25 21:18:01', '2023-09-25 21:18:01'),
(110, 0, 13, 'Income tax expense', 'Use Income tax expense to track income taxes that the company has paid to meet their tax obligations.', 1, '2023-09-25 21:18:01', '2023-09-25 21:18:01'),
(111, 0, 13, 'Insurance', 'Use Insurance to track insurance payments. You may want different accounts of this type for different types of insurance (auto, general liability, and so on).', 1, '2023-09-25 21:18:01', '2023-09-25 21:18:01'),
(112, 0, 13, 'Interest paid', 'Use Interest paid for all types of interest you pay, including mortgage interest, finance charges on credit cards, or interest on loans.', 1, '2023-09-25 21:18:01', '2023-09-25 21:18:01'),
(113, 0, 13, 'Legal and professional fees', 'Use Legal and professional fees to track money to pay to professionals to help you run your business. You may want different accounts of this type for payments to your accountant, attorney, or other consultants.', 1, '2023-09-25 21:18:01', '2023-09-25 21:18:01'),
(114, 0, 13, 'Loss on discontinued operations, net of tax', 'Use Loss on discontinued operations, net of tax to track the loss realised when a part of the business ceases to operate or when a product line is discontinued.', 1, '2023-09-25 21:18:01', '2023-09-25 21:18:01'),
(115, 0, 13, 'Management compensation', 'Use Management compensation to track remuneration paid to Management, Executives and non-Executives. For example, salary, fees, and benefits.', 1, '2023-09-25 21:18:01', '2023-09-25 21:18:01'),
(116, 0, 13, 'Meals and entertainment', 'Use Meals and entertainment to track how much you spend on dining with your employees to promote morale. If you dine with a customer to promote your business, use a Promotional meals account, instead. Be sure to include who you ate with and the purpose of the meal when you enter the transaction.', 1, '2023-09-25 21:18:01', '2023-09-25 21:18:01'),
(117, 0, 13, 'Office/general administrative expenses', 'Use Office/general administrative expenses to track all types of general or office-related expenses.', 1, '2023-09-25 21:18:01', '2023-09-25 21:18:01'),
(118, 0, 13, 'Other miscellaneous service cost', 'Use Other miscellaneous service cost to track costs related to providing services that don\'t fall into another Expense type. This account is also available as a Cost of Sales (COS) account.', 1, '2023-09-25 21:18:01', '2023-09-25 21:18:01'),
(119, 0, 13, 'Other selling expenses', 'Use Other selling expenses to track selling expenses incurred that do not fall under any other category.', 1, '2023-09-25 21:18:01', '2023-09-25 21:18:01'),
(120, 0, 13, 'Payroll expenses', 'Use Payroll expenses to track payroll expenses. You may want different accounts of this type for things like: Compensation of officers, Guaranteed payments, Workers compensation, Salaries and wages, Payroll taxes', 1, '2023-09-25 21:18:01', '2023-09-25 21:18:01'),
(121, 0, 13, 'Rent or lease of buildings', 'Use Rent or lease of buildings to track rent payments you make.', 1, '2023-09-25 21:18:01', '2023-09-25 21:18:01'),
(122, 0, 13, 'Repair and maintenance', 'Use Repair and maintenance to track any repairs and periodic maintenance fees. You may want different accounts of this type to track different types repair & maintenance expenses (auto, equipment, landscape, and so on).', 1, '2023-09-25 21:18:01', '2023-09-25 21:18:01'),
(123, 0, 13, 'Shipping and delivery expense', 'Use Shipping and delivery expense to track the cost of shipping and delivery of goods to customers.', 1, '2023-09-25 21:18:01', '2023-09-25 21:18:01'),
(124, 0, 13, 'Supplies & materials', 'Use Supplies & materials to track the cost of raw goods and parts used or consumed when producing a product or providing a service. This account is also available as a Cost of Sales account.', 1, '2023-09-25 21:18:01', '2023-09-25 21:18:01'),
(125, 0, 13, 'Taxes paid', 'Use Taxes paid to track taxes you pay. You may want different accounts of this type for payments to different tax agencies.', 1, '2023-09-25 21:18:01', '2023-09-25 21:18:01'),
(126, 0, 13, 'Travel expenses - general and admin expenses', 'Use Travel expenses - general and admin expenses to track travelling costs incurred that are not directly related to the revenue-generating operation of the company. For example, flight tickets and hotel costs when performing job interviews.', 1, '2023-09-25 21:18:01', '2023-09-25 21:18:01'),
(127, 0, 13, 'Travel expenses - selling expense', 'Use Travel expenses - selling expense to track travelling costs incurred that are directly related to the revenue-generating operation of the company. For example, flight tickets and hotel costs when selling products and services.', 1, '2023-09-25 21:18:01', '2023-09-25 21:18:01'),
(128, 0, 13, 'Unapplied Cash Bill Payment Expense', 'Unapplied Cash Bill Payment Expense reports the Cash Basis expense from supplier payment cheques you\'ve sent but not yet applied to supplier bills. In general, you would never use this directly on a purchase or sale transaction.', 1, '2023-09-25 21:18:01', '2023-09-25 21:18:01'),
(129, 0, 13, 'Utilities', 'Use Utilities to track utility payments. You may want different accounts of this type to track different types of utility payments (gas and electric, telephone, water, and so on).', 1, '2023-09-25 21:18:01', '2023-09-25 21:18:01'),
(130, 0, 14, 'Cost of labour - COS', 'Use Cost of labour - COS to track the cost of paying employees to produce products or supply services. It includes all employment costs, including food and transportation, if applicable.', 1, '2023-09-25 21:18:01', '2023-09-25 21:18:01'),
(131, 0, 14, 'Equipment rental - COS', 'Use Equipment rental - COS to track the cost of renting equipment to produce products or services. If you purchase equipment, use a Fixed Asset account type called Machinery and equipment.', 1, '2023-09-25 21:18:01', '2023-09-25 21:18:01'),
(132, 0, 14, 'Freight and delivery - COS', 'Use Freight and delivery - COS to track the cost of shipping/delivery of obtaining raw materials and producing finished goods for resale.', 1, '2023-09-25 21:18:01', '2023-09-25 21:18:01'),
(133, 0, 14, 'Other costs of sales - COS', 'Use Other costs of sales - COS to track costs related to services or sales that you provide that don\'t fall into another Cost of Sales type.', 1, '2023-09-25 21:18:01', '2023-09-25 21:18:01'),
(134, 0, 14, 'Supplies and materials - COS', 'Use Supplies and materials - COS to track the cost of raw goods and parts used or consumed when producing a product or providing a service.', 1, '2023-09-25 21:18:01', '2023-09-25 21:18:01'),
(135, 0, 15, 'Amortisation', 'Use Amortisation to track amortisation of intangible assets. Amortisation is spreading the cost of an intangible asset over its useful life, like depreciation of fixed assets. You may want an amortisation account for each intangible asset you have.', 1, '2023-09-25 21:18:01', '2023-09-25 21:18:01'),
(136, 0, 15, 'Depreciation', 'Use Depreciation to track how much you depreciate fixed assets. You may want a depreciation account for each fixed asset you have.', 1, '2023-09-25 21:18:01', '2023-09-25 21:18:01'),
(137, 0, 15, 'Exchange Gain or Loss', 'Use Exchange Gain or Loss to track gains or losses that occur as a result of exchange rate fluctuations.', 1, '2023-09-25 21:18:01', '2023-09-25 21:18:01'),
(138, 0, 15, 'Other expense', 'Use Other expense to track unusual or infrequent expenses that don\'t fall into another Other Expense type.', 1, '2023-09-25 21:18:01', '2023-09-25 21:18:01'),
(139, 0, 15, 'Penalties and settlements', 'Use Penalties and settlements to track money you pay for violating laws or regulations, settling lawsuits, or other penalties.', 1, '2023-09-25 21:18:01', '2023-09-25 21:18:01'),
